import entities.Tariffs;import javax.xml.bind.JAXBContext;import javax.xml.bind.JAXBException;import javax.xml.bind.Unmarshaller;import java.net.URL;public class XmlToObject {    public static void main(String[] args) {        try {            String fileName = "xml/tariff.xml";            URL url = ClassLoader.getSystemResource(fileName);            JAXBContext jaxbContext = JAXBContext.newInstance(Tariffs.class);            Unmarshaller jaxbUnmarshaller = jaxbContext.createUnmarshaller();            Tariffs tariffs= (Tariffs) jaxbUnmarshaller.unmarshal(url);            System.out.println(tariffs.toString());        } catch (JAXBException e) {            e.printStackTrace();        }    }}